import cv2
import base64
import numpy as np

def movie_picture():
    base64_image = ""
    
    return base2cv(base64_image)


def base2cv(base64_image):
    # 假设 base64_image 是包含 Base64 编码的 PNG 图像的字符串

    # 将 Base64 字符串解码为二进制数据
    image_data = base64.b64decode(base64_image)

    # 将二进制数据转换为 numpy 数组
    nparr = np.frombuffer(image_data, np.uint8)

    # 解码为 OpenCV 图像格式（带透明度）
    image_cv2 = cv2.imdecode(nparr, cv2.IMREAD_UNCHANGED)
    
    # 修改透明部分颜色
    alpha_channel = image_cv2[:, :, 3]

    # 将透明部分设置为白色
    image_cv2[alpha_channel == 0] = [255, 255, 255, 255]
    
    return image_cv2





if __name__ == "__main__":
    # 读取PNG图像
    image = cv2.imread('/home/nemo/Mourn/a2pip/src/happytorch/visualization/movie.png', cv2.IMREAD_UNCHANGED)

    # 将图像转换为Base64编码
    _, buffer = cv2.imencode('.png', image)
    base64_image = base64.b64encode(buffer).decode('utf-8')

    # 打印Base64编码的图像
    print(base64_image)